import { reactive } from 'vue'
import { defineStore } from 'pinia'

export const useCollectionStore = defineStore('collection', () => {
	const items = reactive([])

	for (let i = 0; i < 8; i++) {
		items.push({
			id: i,
			name: 'Teste',
			description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Inventore sed consequuntur error repudiandae numquam deserunt quisquam repellat libero asperiores earum!',
			img: ''
		})
	}

	return { items }
})
